import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom'; // BrowserRouter를 직접 불러옵니다.
import App from './App';
import GlobalStyles from './styles/GlobalStyles';
import theme from './styles/Theme';

// createRoot 대신 ReactDOM.render를 사용합니다.
ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <GlobalStyles />
      <App />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
